import React, { Component } from 'react';
//App Component
class Pricing extends Component {
  render() {
    return (
      <div className="create">
          <div>
          <h1><span className="font-weight-bold">Pricing</span></h1>
          </div>
          <div>
              <form>
                    <h4>Who do you want to deliver your Grubhub orders?</h4>
                    <button>Sign in</button>
              </form>
          </div>
         </div>
    );
  }
}
export default Pricing;
